import React, { useEffect, useState } from 'react';
import './monitor.css';
import logo from '../logo1.png'
import axios from 'axios';

import { io } from 'socket.io-client';

const socket = io('http://localhost:3001', { transports: ['websocket'] });


const Monitor = () => {
    const [doctorRoom, setDoctorRoom] = useState([]);
    const [receptionRoom, setReceptionRoom] = useState([]);
    const [ECGRoom, setECGRoom] = useState([]);
    const [treatmentRoom, setTreatmentRoom] = useState([]);
    const [triageRoom, setTriageRoom] = useState([]);

    const doctorRoomUrl = 'http://localhost:3001/main-table/doctorQueue';
    const receptionRoomUrl = 'http://localhost:3001/main-table/receptionQueue';
    const ecgRoomUrl = 'http://localhost:3001/main-table/ecgQueue';
    const treatmentRoomUrl = 'http://localhost:3001/main-table/treatmentQueue';
    const triageRoomUrl = 'http://localhost:3001/main-table/triageQueue';


    useEffect(() => {
        


        axios.get(doctorRoomUrl)
            .then(response => {
                setDoctorRoom(response.data.data);
            })
            .catch(error => {
                console.error('Error fetching reception queue data:', error);
            });

        axios.get(receptionRoomUrl)
            .then(response => {
                setReceptionRoom(response.data.data);
            })
            .catch(error => {
                console.error('Error fetching reception queue data:', error);
            });
        axios.get(ecgRoomUrl)
            .then(response => {
                setECGRoom(response.data.data);
            })
            .catch(error => {
                console.error('Error fetching reception queue data:', error);
            });
        axios.get(treatmentRoomUrl)
            .then(response => {
                setTreatmentRoom(response.data.data);
            })
            .catch(error => {
                console.error('Error fetching reception queue data:', error);
            });
        axios.get(triageRoomUrl)
            .then(response => {
                setTriageRoom(response.data.data);
            })
            .catch(error => {
                console.error('Error fetching reception queue data:', error);
            });
    }, []);

    useEffect(() => {
        socket.on('updateQueue', () => {
           
        axios.get(doctorRoomUrl)
        .then(response => {
            setDoctorRoom(response.data.data);
        })
        .catch(error => {
            console.error('Error fetching reception queue data:', error);
        });

    axios.get(receptionRoomUrl)
        .then(response => {
            setReceptionRoom(response.data.data);
        })
        .catch(error => {
            console.error('Error fetching reception queue data:', error);
        });
    axios.get(ecgRoomUrl)
        .then(response => {
            setECGRoom(response.data.data);
        })
        .catch(error => {
            console.error('Error fetching reception queue data:', error);
        });
    axios.get(treatmentRoomUrl)
        .then(response => {
            setTreatmentRoom(response.data.data);
        })
        .catch(error => {
            console.error('Error fetching reception queue data:', error);
        });
    axios.get(triageRoomUrl)
        .then(response => {
            setTriageRoom(response.data.data);
        })
        .catch(error => {
            console.error('Error fetching reception queue data:', error);
        });
        })
      }, [])
    





